import { Col, Container, Row } from 'react-bootstrap';
import Menu from '../menu/menu'

import Header from "../header/header";
import Ads from '../menu/Ads.js'

const HomePage = () => {
    return (<>
        <Header />
  
      <Container fluid>
        <Row>
          <Col xs={2}>
            <Menu/>
            <Ads/>
          </Col>
          <Col xs={6}>
            {/* <PostsList/> */}
          </Col>
          <Col xs={4}>
              {/* <ProfileSectionContainer/> */}
              {/* <RecentFollowers /> */}
          </Col>
        </Row>
      </Container>
    </>
    );
  };
  export default HomePage;
